import React,{useState,useEffect} from"react"
import axios from "axios";
import { useParams } from 'react-router-dom';

export default function VehicleDetail(){

    const{id}=useParams();

    const [vehicle, setVehicles] = useState([]);

    const getVehicle = () => {
        axios.get('http://localhost:6060/Vehicle/get/'+id)
        .then((res) => {
            console.log(res.data);
            setVehicles(res.data.Vehicle);
            
        })
        .catch((err) => {
            alert(err.message);
        });    
        
    };

    

    useEffect(() => {
        getVehicle();
        
    }, []);

    return(

        <div>
                <div class="vehicle-cards">
                <div class="vehicle-card"> 
                    <div class="vehicle-details">
                    <h3>{vehicle.regnumber}</h3>   
                    <p>Brand:{vehicle.brand}</p>
                    <p>Model:{vehicle.model}</p>
                    <p>Year:{vehicle.year}</p>
                    <p>Type:{vehicle.type}</p>
                    <p>Fuel:{vehicle.fueltype}</p>
                    <p>Price/Day:{vehicle.priceperday}</p>
                    <p>Transmission:{vehicle.regnumber}</p>
                    <p>Available:{vehicle.available}</p>
                    <p>{id}</p>
                    </div>
                </div>
                
                </div>
                
                <div class="vehicle-image">
                    <img src={vehicle.image} alt="Vehicl" />
                    </div>
                   



        </div>
    )
}
